import React from "react";
import {
  Modal,
  ModalOverlay,
  ModalContent,
  ModalHeader,
  ModalFooter,
  ModalBody,
  ModalCloseButton,
  useDisclosure,
} from "@chakra-ui/react";
import { CarouselDemo } from "./CarouselDemo";

export const GifModal = () => {
  return (
    <div>
      <Center>
        <Button onClick={onOpen}>Explore GIFs</Button>
      </Center>
      <Modal
        isOpen={isOpen}
        onClose={onClose}
        motionPreset="slideInBottom"
        size={"xl"}
      >
        <ModalOverlay />
        <ModalContent>
          <ModalHeader>Find Awesome GIFs!</ModalHeader>
          <ModalCloseButton />
          <ModalBody>
            <CarouselDemo />
          </ModalBody>
          <ModalFooter>
            <Button colorScheme="blue" mr={3} onClick={onClose}>
              Close
            </Button>
          </ModalFooter>
        </ModalContent>
      </Modal>
    </div>
  );
};
